  6,\n\t\"tags\": [],\n\t\"title\": \"Fall transport - A study to compare smolt-to-adult
  return rates (SARs) of Snake River fall Chinook salmon under alternative transport
  and dam operational strategies\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-03-21T19:58:53.799742\",\n\t\"name\": \"fall-transport-a-study-to-compare-smolt-to-adult-return-rates-sars-of-snake-river-fall-chinook-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This U.S. Army Corps of Engineers (USACE)-funded
  study that began in 2005 compares the SARs of PIT tagged juvenile hatchery Snake
  River fall Chinook that are split into two groups, released above Lower Granite
  Dam, and when detected at downstream dams, one group is transported (if detected)
  and the other group bypassed if detected. When adult returns are complete, their
  SARs will be compared to determine the efficacy of smolt transport of this stock.
  Scales are collected on returning adults to determine age at ocean entry. The study
  is a collaborative effort with the U.S. Fish and Wildlife Service (USFWS), Washington
  Dept. of Fish and Wildlife (WDFW), and the Nez Perce Tribe (NPT). Juvenile releases
  began in 2005, and will be completed in 2012. Adult returns will be completed in
  2016, with a final report provided to the USACE and region summarizing study results.nnFall
  Chinook transport study data.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
